import ExpenseItem from './ExpenseItem'
import './ExpenseList.css'

const ExpenseList = () => {
  return (
    <ul>
      {filterExpenses.map((extract) => (
        <ExpenseItem
          key={extract.id}
          title={extract.title}
          amount={extract.amount}
          date={extract.date}
        />
      ))}
    </ul>
  )
}

export default ExpenseList
